using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class WindGirderOutputModel : Notifier	{		public WindGirderOutputModel()		{					No = "";			Type = "";			Material = "";			Elevation = "";			Size = "";		}				private string _No;		public string No			{				get { return _No; }				set				{					_No = value;					OnPropertyChanged(nameof(No));				}			}				private string _Type;		public string Type			{				get { return _Type; }				set				{					_Type = value;					OnPropertyChanged(nameof(Type));				}			}				private string _Material;		public string Material			{				get { return _Material; }				set				{					_Material = value;					OnPropertyChanged(nameof(Material));				}			}				private string _Elevation;		public string Elevation			{				get { return _Elevation; }				set				{					_Elevation = value;					OnPropertyChanged(nameof(Elevation));				}			}				private string _Size;		public string Size			{				get { return _Size; }				set				{					_Size = value;					OnPropertyChanged(nameof(Size));				}			}			}}